import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import Tilt from "vanilla-tilt";
import "./App.css"; // Assuming you have your styles in App.css file
import "./mediaqueries.css"; // Assuming you have your media queries styles in mediaqueries.css file

function App() {
  useEffect(() => {
    AOS.init();
    Tilt.init(document.querySelectorAll(".tilt"));
  }, []);

  return (
    <div>
      {/* ========== SIDEBAR ========== */}
      <div className="nav_toggle" id="nav-toggle">
        <i className="uil uil-bars"></i>
      </div>

      <aside className="sidebar" id="sidebar">
        <nav className="nav">
          <div className="nav_menu">
            <div className="menu">
              <ul className="nav_list">
                <li className="nav_item">
                  <a href="#home" className="nav_link">
                    Home
                  </a>
                </li>
                {/* ... (Repeat for other navigation items) */}
              </ul>
            </div>
          </div>

          <div className="nav_close" id="nav-close">
            <i className="uil uil-multiply"></i>
          </div>
        </nav>
      </aside>

      {/* ========== MAIN ========== */}
      <main className="main">
        {/* ===== Home ===== */}
        <section className="home" id="home">
          <div className="home_container container grid">
            {/* ... (Content for the Home section) */}
          </div>
        </section>

        {/* ===== HOBBY ===== */}
        <section className="montero-hobby" id="about">
          <div className="inner-width">
            {/* ... (Content for the Hobby section) */}
          </div>
        </section>

        {/* ... (Repeat for other sections like Movies, Interest, Contact, and Footer) */}

        {/* ========== FOOTER ========== */}
        <footer>
          <div className="footer-contnt">
            {/* ... (Content for the Footer section) */}
          </div>
        </footer>
      </main>

      {/* ========== JAVASCRIPT ========== */}
      <script type="text/javascript" src="script.js"></script>
    </div>
  );
}

export default App;
